import * as React from 'react';

import { ImageCard } from '../../components/image-card';
import { SearchInput } from '../../components/search-input';

require('./index.scss');

export class BooksWrapper extends React.Component {
   constructor(props) {
      super(props);

      this.state = {
         books: []
      };

      setTimeout(() => {
         this.setState({
            books: [{
               name: 'Angular权威指南',
               href: 'data:image/jpg;base64,'
            }]
         })
      }, 1000);
   }

   render() {
      let book = this.state.books[0];
      let books = [];

      for(let i = 0; i < 10; i++) {
         if(!book) {
            continue;
         }

         books.push({
            text: book.name,
            src: book.href
         });
      }

      return (
         <div className="books-wrapper">
            <div className="filter-layer">
               <div className="search-input-layout">
                  <SearchInput />
               </div>
            </div>
            {
               books.map((book, idx) => {
                  return <div className="book-layer-wrapper" key={idx}>
                        <ImageCard info={book} />
                     </div>;

               })
            }
         </div>
      );
   }
}